🎥 by @healthyfitnessmeals
·
📝 Ingredientes:
1 kilo de pechugas de pollo
Sal marina y pimienta negra recién molida
 ¼ de taza de harina de trigo 
 3 cucharadas de aceite de oliva dividido
 4 dientes de ajo picados
 1 cebolla pequeña picada
 1 taza de caldo de hueso de pollo
 1 jugo de limón
 ½ taza de crema de coco mezclada antes de usar ( o crema de tu preferencia)
 ¼ de taza de alcaparras escurridas
 Rodajas de limón para servir
 Hierbas recién picadas para decorar .
🔠 Instrucciones
🔸Sazone el pollo machacado con una pizca de sal y pimienta en ambos lados.  Coloca la harina en un tazón poco profundo.
🔸Calienta 2 cucharadas de aceite en una sartén grande a fuego medio.  Trabajando con una chuleta a la vez, drague el pollo por ambos lados en la harina.  Sacude el exceso de harina y agrégalos a la sartén.
🔸Cocine el pollo durante 4 minutos por lado, o hasta que el pollo esté bien cocido y el recubrimiento esté dorado.  Transfiera el pollo dorado a un plato y déjelo a un lado.
🔸En la misma sartén, baja el fuego a medio-bajo y agrega la cucharada restante de aceite, cebolla y ajo.  Saltee durante 2-3 minutos, revolviendo ocasionalmente, hasta que las cebollas se ablanden.
🔸Agregue el caldo y el jugo de limón y raspe los trozos dorados del fondo de la sartén con una espátula de silicona.  Eleve el fuego a medio-alto y hierva la mezcla durante 3 minutos, hasta que se reduzca a la mitad, revolviendo ocasionalmente.
🔸Agregue la crema de coco y las alcaparras, y coloque el pollo en la salsa.  Cocine a fuego lent
